import React from 'react';


const NotFoundError = () => {
   return (
      <div className="wrapper">
         <div className="not-found__block">
            <h1>Такая страница не существует!!</h1>
            <p>Повторите попытку</p>
         </div>
      </div>
   )
}
export default NotFoundError;
